

CREATE TABLE public.pessoas (
    codigo SERIAL,
    primeironome character varying(200) NOT NULL,
    cpf character(11),
    rg character varying(25),
    orgaoexpedidor character varying(40),
    sexo character(1),
    datanascimento date,
    estadocivil character varying(60),
    nacionalidade character varying(60),
    naturalidade character varying(60),
    ufnascimento character(2),
    nomemae character varying(60),
    nomepai character varying(60),
    gruposaguineo character(2),
    fatorrh character varying(60),
    possuideficiencia boolean,
    racacor character varying(40),
    escolaridade character varying(60),
    foto character varying(50),
    datalog timestamp without time zone,
    codigonacionalidade integer,
    codigoracacor character(2),
    etnia character varying(255),
    codigoetnia character(4)
);

create schema academico;


ALTER TABLE ONLY public.pessoas
    ADD CONSTRAINT cons_unique_cpf UNIQUE (cpf);

ALTER TABLE ONLY public.pessoas
    ADD CONSTRAINT pessoas_pkey PRIMARY KEY (codigo);
 
 
CREATE TABLE public.alunos (
    codigo SERIAL,
    cartaosus character varying(20),
    flyalunos character varying(150),
    codigounicomec character varying(100),
    numeronis character varying(100),
    recebeescolarizacao character(3),
    localresidencia character varying(150),
    utilizatransporte character(3) NOT NULL,
    tipoveiculoescolar character varying(150) NOT NULL,
    formaingresso character varying(150),
    status character varying(150) NOT NULL,
    codigoescola integer NOT NULL,
    codigopessoa integer NOT NULL,
    idestado character varying(30),
    foto character varying(255),
    datafalecimento timestamp without time zone
);




ALTER TABLE ONLY public.alunos
    ADD CONSTRAINT alunos_pkey PRIMARY KEY (codigo);



ALTER TABLE ONLY public.alunos
    ADD CONSTRAINT alunos_codigopessoa_fkey FOREIGN KEY (codigopessoa) REFERENCES public.pessoas(codigo);
    
    
    
    CREATE TABLE academico.cursos (
    codigo SERIAL,
    nome character varying(150) NOT NULL,
    sigla character varying(80) NOT NULL,
    resolucao character varying(200),
    dataresolucao timestamp without time zone,
    cargahorariatotal integer,
    status boolean,
    datalog timestamp without time zone
);

 



 

ALTER TABLE ONLY academico.cursos
    ADD CONSTRAINT cursos_pkey PRIMARY KEY (codigo);

select p.primeironome as nomealuno, p.cpf, p.rg, p.orgaoexpedidor
from public.pessoas p,
public.alunos a
where p.primeironome like 'A%'

order by p.primeironome asc;

select * from public.pessoas p
where p.primeironome like '%A';
